"    <div id=\"topicTitle\">",
"     Patient information: Spasmodic dysphonia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/spasmodic-dysphonia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H2368302378\">",
"      <span class=\"h1\">",
"       What is spasmodic dysphonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Spasmodic dysphonia is a rare disorder that affects the muscles that control the vocal cords in your throat (",
"      <a class=\"graphic graphic_figure graphicRef83209 \" href=\"UTD.htm?16/7/16496\">",
"       figure 1",
"      </a>",
"      ). The disorder makes it hard for you to speak normally.",
"     </p>",
"     <p>",
"      Spasmodic dysphonia affects mostly women and usually starts in middle age (when the person is between 30 and 50 years old).",
"     </p>",
"     <p>",
"      There are 2 main types spasmodic dysphonia:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        The most common type, called the &ldquo;",
"        <strong>",
"         ad",
"        </strong>",
"        ductor type,&rdquo; causes a person&rsquo;s speech to sound halting, strained, and strangled.",
"       </li>",
"       <li>",
"        The other type, called the &ldquo;",
"        <strong>",
"         ab",
"        </strong>",
"        ductor type,&rdquo; a causes a person&rsquo;s speech to sound breathy, like a whisper.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302410\">",
"      <span class=\"h1\">",
"       What causes spasmodic dysphonia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Doctors don&rsquo;t know what causes it. They do know it happens because the muscles in the throat freeze up or spasm. They also suspect the condition happens because of a problem in a part of the brain that controls movement.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302425\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, if you develop a new speech problem that does not go away, see a doctor or nurse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302440\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. Sometimes doctors use a special tool called a &ldquo;nasopharyngoscope&rdquo; to look at the vocal cords.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302455\">",
"      <span class=\"h1\">",
"       How is spasmodic dysphonia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main treatment is injections of a medicine called botulinum toxin (also called BoTox) into the muscles in the voice box. These injections help the muscles relax and reduce the symptoms of spasmodic dysphonia.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H2368302470\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
