var title_f21_8_21644="Tryptase and histamine collection instructions";
var content_f21_8_21644=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F72041&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F72041&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Instructions for optimal collection and handling of blood samples for measurement of tryptase and histamine following suspected anaphylaxis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Tryptase* (serum or plasma)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        When to collect the sample:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Blood should be collected between 15 minutes and 3 hours after symptom onset whenever possible; samples collected &lt;15 minutes or &gt;3 hours after symptom onset are less likely to be informative.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        How to collect the sample:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Blood can be drawn using usual technique. Collect blood for serum (red top tube) or plasma (tube with heparin, citrate or EDTA). A minimum of 1 mL is required.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        For postmortem samples, collect blood from the femoral artery or vein, not the heart.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        How to process the sample:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Serum or plasma should be placed on ice and frozen as soon as possible. Samples should be shipped frozen by overnight courier if the assay cannot be performed on site.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Histamine (plasma)",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        When to collect the sample:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Plasma for histamine levels should be collected between 15 and 60 minutes after symptom onset; samples collected &lt;15 minutes or &gt;60 minutes after symptom onset are less likely to be informative.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        How to collect the sample:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Pull blood manually (DO NOT use vacuum tubes) under gentle pressure through a 20 gauge or larger needle into a syringe containing either citrate or EDTA.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        How to process the sample:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Anticoagulated blood should be placed on ice and centrifuged to separate plasma from cells as soon as possible, and then the plasma&nbsp;frozen until ready to be analyzed.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    The assay for total tryptase is standardized.",
"    <div class=\"footnotes\">",
"     * Normal values are similar in adults and in infants, children, and teens ages 6 months to 18 years. Komarow HD, Hu Z, Brittain E, et al. Serum tryptase levels in atopic and nonatopic children. J Allergy Clin Immunol 2009; 124:845.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      Plasma is used to avoid the artifactual release of histamine from basophils that can occur during blood clotting.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
var script_f21_8_21644=[""].join("\n");
var outline_f21_8_21644=null;
var title_f21_8_21645="Encephalitis clinical clues";
var content_f21_8_21645=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F71744&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F71744&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical findings and possible etiologic agent(s) in encephalitis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Clinical presentation",
"       </td>",
"       <td class=\"subtitle1\">",
"        Possible infectious agent(s)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        General findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatitis",
"       </td>",
"       <td>",
"        Herpes simplex virus (infant only), enterovirus (in infants),",
"        <em>",
"         Coxiella burnetii",
"        </em>",
"        ; any severe hepatitis can cause encephalopathy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Lymphadenopathy",
"       </td>",
"       <td>",
"        HIV, Epstein-Barr virus, cytomegalovirus, measles virus, rubella virus, West Nile virus,",
"        <em>",
"         Treponema pallidum",
"        </em>",
"        ,",
"        <em>",
"         Bartonella henselae",
"        </em>",
"        and other bartonella species,",
"        <em>",
"         Mycobacterium tuberculosis",
"        </em>",
"        ,",
"        <em>",
"         Toxoplasma gondii",
"        </em>",
"        ,",
"        <em>",
"         Trypansoma brucei gambiense",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Parotitis",
"       </td>",
"       <td>",
"        Mumps virus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rash",
"       </td>",
"       <td>",
"        Herpes simplex virus, varicella zoster virus, herpes B virus, human herpesvirus 6, West Nile virus, rubella virus, some enteroviruses, HIV,",
"        <em>",
"         Rickettsia rickettsii",
"        </em>",
"        ,",
"        <em>",
"         Mycoplasma pneumoniae",
"        </em>",
"        ,",
"        <em>",
"         Borrelia burgdorferi",
"        </em>",
"        ,",
"        <em>",
"         T. pallidum",
"        </em>",
"        ,",
"        <em>",
"         Ehrlichia chaffeensis",
"        </em>",
"        ,",
"        <em>",
"         Anaplasma phagocytophilum",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Respiratory tract findings",
"       </td>",
"       <td>",
"        Venezuelan equine encephalitis virus, Nipha virus, Hendra virus, influenza virus, adenovirus,",
"        <em>",
"         M. pneumoniae",
"        </em>",
"        ,",
"        <em>",
"         C. burnetii",
"        </em>",
"        ,",
"        <em>",
"         M. tuberculosis",
"        </em>",
"        ,",
"        <em>",
"         Histoplasma capsulatum",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Retinitis",
"       </td>",
"       <td>",
"        Cytomegalovirus,",
"        <em>",
"         T. gondii",
"        </em>",
"        , West Nile virus,",
"        <em>",
"         B. henselae",
"        </em>",
"        ,",
"        <em>",
"         T. pallidum",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urinary symptoms (dysuria, urgency, incontinence)",
"       </td>",
"       <td>",
"        St. Louis encephalitis virus (during prodrome)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Neurologic findings",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cerebellar ataxia",
"       </td>",
"       <td>",
"        Varicella zoster virus (children), Epstein-Barr virus, mumps virus, St. Louis encephalitis virus,",
"        <em>",
"         Tropheryma whipplei",
"        </em>",
"        ,",
"        <em>",
"         T. brucei gambiense",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cranial nerve abnormalities",
"       </td>",
"       <td>",
"        Herpes simplex virus, Epstein-Barr virus,",
"        <em>",
"         Listeria monocytogenes",
"        </em>",
"        ,",
"        <em>",
"         M. tuberculosis",
"        </em>",
"        ,",
"        <em>",
"         T. pallidum",
"        </em>",
"        ,",
"        <em>",
"         B. burgdorferi",
"        </em>",
"        ,",
"        <em>",
"         T. whipplei",
"        </em>",
"        ,",
"        <em>",
"         Cryptococcus neoformans",
"        </em>",
"        ,",
"        <em>",
"         Coccidioides species",
"        </em>",
"        ,",
"        <em>",
"         H. capsulatum",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Dementia",
"       </td>",
"       <td>",
"        HIV, human transmissible spongiform encephalopathies (sCJD and vCJD),",
"        <em>",
"         T. pallidum",
"        </em>",
"        ,",
"        <em>",
"         T. whipplei",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Myorhythmia",
"       </td>",
"       <td>",
"        <em>",
"         T. whipplei",
"        </em>",
"        (oculomasticatory)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Parkinsonism (bradykinesia, masked facies, cogwheel rigidity, postural instability)",
"       </td>",
"       <td>",
"        Japanese encephalitis virus, St. Louis encephalitis virus, West Nile virus, Nipah virus,",
"        <em>",
"         T. gondii",
"        </em>",
"        ,",
"        <em>",
"         T. brucei gambiense",
"        </em>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Poliomyelitis-like flaccid paralysis",
"       </td>",
"       <td>",
"        Japanese encephalitis virus, West Nile virus, tick-borne encephalitis virus, enteroviruses (enterovirus 71, coxsackieviruses), poliovirus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Rhomboencephalitis",
"       </td>",
"       <td>",
"        Enterovirus 71, herpes simplex virus, West Nile virus,",
"        <em>",
"         L. monocytogenes",
"        </em>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Modified with permission from: Tunkel AR, Glaser CA, Bloch KC, et al. The management of encephalitis: clinical practice guidelines by the Infectious Diseases Society of America. Clin Infect Dis 2008; 47:303. Copyright &copy; 2008 University of Chicago Press.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
